import React from 'react';

const Dropdown = () => {

    return (
        <>
            <div class="dropdown">
                <button onclick="myFunction()" className="dropbtn">Dropdown</button>
                <div id="myDropdown" class="dropdown-content">
                    <a href="#">Link 1</a>
                    <a href="#">Link 2</a>
                    <a href="#">Link 3</a>
                </div>
            </div>
        </>
    )
}
export default Dropdown
